let initialDateS = null;
let finalDateS = null;
$('#weekpicker').datepicker({
    autoclose: true,
    format: 'yyyy-mm-dd',
    forceParse: false
}).on("changeDate", function(e) {
    var startDate,
        endDate;
    //console.log(e.date);
    var date = e.date;
    startDate = new Date(date.getFullYear(), date.getMonth(), date.getDate() - date.getDay());
    endDate = new Date(date.getFullYear(), date.getMonth(), date.getDate() - date.getDay() + 6);
    //--- --- ---//
    //--- --- ---//
    //$('#weekpicker').datepicker("setDate", startDate);
    $('#weekpicker').datepicker('update', startDate);
    //--- --- ---//
    var daydi = startDate.getDate();
    if (startDate.getDate() < 10) {
        daydi = "0" + daydi;
    }
    var monthdi = startDate.getMonth() + 1;
    if ((startDate.getMonth() + 1) < 10) {
        monthdi = "0" + monthdi;
    }
    //--- --- ---//
    var daydf = endDate.getDate();
    if (endDate.getDate() < 10) {
        daydf = "0" + daydf;
    }
    var monthdf = endDate.getMonth() + 1;
    if ((endDate.getMonth() + 1) < 10) {
        monthdf = "0" + monthdf;
    }
    //--- --- ---//
    $('#weekpicker').val(startDate.getFullYear() + '/' + monthdi + '/' + daydi + ' - ' + endDate.getFullYear() + '/' + monthdf + '/' + daydf);
});
