function validateDates() {
    let week = document.querySelector('#weekpicker').value;
    if (week != '') {
        let dates = week.split('-');
        if (dates.length == 2 && dates[0].trim() != '' && dates[1].trim() != '') {
            let initialDate = dates[0].trim();
            let finalDate = dates[1].trim();
            if (CheckValidDate(initialDate) && CheckValidDate(finalDate)) {
                initialDateS = initialDate;
                finalDateS = finalDate;
                searchStudents();
            } else {
                console.log('err 3');
                Swal.fire('Atención!', 'Ingrese un rango de fechas válidas', 'warning');
            }
        } else {
            console.log('err 2');
            Swal.fire('Atención!', 'Ingrese un rango de fechas válidas', 'warning');
        }
    } else {
        console.log('err 1');
        Swal.fire('Atención!', 'Ingrese un rango de fechas válidas', 'warning');
    }
}
