function createPDF(imgLogo, data, action) {
    //--- --- ---//
    console.log(data);
    var body_table = [];
    for (var i = 0; i < data.comments.length; i++) {
        body_table.push([fixLetter(data.comments[i].name_subject) + '\n' + data.comments[i].nombre_hebreo, {
            content: fixLetter(data.comments[i].comments),
            rowSpan: 2,
            styles: {
                halign: 'left'
            }
        }]);
        body_table.push([{
            content: "ID ASSG: " + data.comments[i].id_assignment,
            styles: {
                halign: 'left',
                fontSize: 5
            }
        }]);
    }
    //--- --- ---//
    window.jsPDF = window.jspdf.jsPDF;
    var doc = new jsPDF({
        orientation: 'p',
        format: 'letter',
    });
    //--- --- ---/
    const pdfWidth = doc.internal.pageSize.getWidth() - 19;
    doc.addImage(imgLogo, "jpg", 11, 5, pdfWidth, 30);
    //--- --- ---//
    doc.setFontSize(11);
    doc.text(15, 52, "Alumno: " + data.info_student.student_name.toUpperCase());
    doc.text(15, 59, "Grado: " + data.info_student.degree + " Yeshivá Ketaná");
    doc.text(15, 66, "Fecha: " + getDateString(initialDateS, finalDateS));
    //--- --- ---//
    doc.addFileToVFS('js/vendor/jsPDF/ShlomoSemiStam-normal.ttf', getFontShlomoSemiStam());
    doc.addFont('js/vendor/jsPDF/ShlomoSemiStam-normal.ttf', 'ShlomoSemiStam-normal', 'normal');
    //--- --- ---//
    doc.autoTable({
        startY: 72,
        headStyles: {
            fillColor: [216, 69, 40],
            textColor: [255, 255, 255],
            lineWidth: 0.1,
            lineColor: [0, 0, 0],
            fontSize: 11,
            fontStyle: 'bold',
            valign: "middle",
        },
        styles: {
            font: "ShlomoSemiStam-normal",
            align: 'right',
            isInputVisual: false,
            isOutputVisual: true,
            isInputRtl: false,
            isOutputRtl: false
        },
        bodyStyles: {
            //halign: 'center',
            fontSize: 10,
            lineWidth: 0.1,
            lineColor: [0, 0, 0],
        },
        head: [
            [{
                content: "Materia",
                styles: {
                    halign: "center",
                },
            }, {
                content: "Detalle de lo estudiado",
                styles: {
                    halign: "center",
                },
            }, ]
        ],
        body: body_table,
    });
    //--- --- ---//
    //--- --- ---//
    doc.setFontSize(9);
    doc.text(15, 240, 'COMENTARIOS:');
    doc.setDrawColor(0, 0, 0);
    doc.setLineWidth(0.05);
    doc.line(42, 241, 195, 241);
    doc.line(15, 249, 195, 249);
    doc.line(15, 257, 195, 257);
    //--- --- ---//
    doc.setFontSize(7);
    const date = new Date();
    let current_date = date.getDate() + "/" + (date.getMonth() + 1) + "/" + date.getFullYear();
    doc.text(16, 273, "Fecha de emisión " + current_date + "  |  " + data.info_student.student_code);
    //--- --- ---//
    var string = doc.output('datauristring');
    //--- --- ---//
    if(action == 'show'){
        var embed = "<embed width='100%' height='100%' src='" + string + "'/>"
        var x = window.open();
        x.document.open();
        x.document.write(embed);
        x.document.close();
        swal.close();
    } else if(action == 'send'){
        let obj_file = {
            id_student: data.info_student.id_student,
            file64: string
        };
        let files = [obj_file];
        sendPDFMailer(files);
    }
    //--- --- ---//
}

