//--- --- ---//
function fixLetter(str) {
    const regex = /[a-zA-Z]/;
    if (regex.test(str)) {
        return str;
    } else {
        var final_str = '';
        var lines = str.split('\n');
        //console.log(lines);
        lines.forEach(function callback(currentValue, index, array) {
            final_str += currentValue.split('').reverse().join('');
            if ((index + 1) < lines.length) {
                final_str += '\n';
            }
        });
        return final_str;
    }
}
