function getDateString(initialDate, finalDate) {
    let arr_months = ['', 'Enero', 'Febrero', 'Marzo', 'Abril', 'Mayo', 'Junio', 'Julio', 'Agosto', 'Septiembre', 'Octubre', 'Noviembre', 'Diciembre'];
    let arr_initial = initialDate.split('/');
    let arr_final = finalDate.split('/');
    let string_date = arr_initial[2] + " de " + arr_months[parseInt(arr_initial[1])] + " de " + arr_initial[0] + " al " + arr_final[2] + " de " + arr_months[parseInt(arr_final[1])] + " de " + arr_final[0];
    return string_date;
}

